import React from 'react';
import { Wrapper, Header, H1, HorizontalScrollPage, Flexbox, SmallContainer} from '../components'

class WatchOrder extends React.Component {
	constructor( props ) {
		super(props); 
		this.state = {
			searchField: '',
		}
	}

	onSearchChange = (event) => {
		this.setState({searchField: event.target.value})
	}

	render() {

		return(
		    <Wrapper>
			    <Header>
			    	<H1 big>MCU OVERVIEW</H1>		    	
			    </Header>

			    <HorizontalScrollPage>
			    	<section>
			    		<H1>Phase 1</H1>
			    		<Flexbox height='100%'> {/* The Whiteboard */}
			    			<Flexbox width='200px' height='100%' background='gray'> {/* The Section */}
			    				<Flexbox width='90%' height='90%' background='black'> {/* The Card/s */}
			    				<H1>IRON MAN</H1>
			    				</Flexbox>
			    				<Flexbox width='90%' height='90%' background='black'> {/* The Card/s */}
			    				<H1>IRON MAN</H1>
			    				</Flexbox>
			    			}
			    			</Flexbox>
			    			<Flexbox width='200px' height='100%' background='gray'>
			    				<H1>IRON MAN</H1>
			    			</Flexbox>
			    		</Flexbox>
			    	</section>
			    	<section>
			    		<H1>Phase 2</H1>
			    	</section>
			    	<section>
			    		<H1>Phase 3</H1>
			    	</section>	
			    	<section>
			    		<H1>Phase 4</H1>
			    	</section>	
			    	<section>
			    		<H1>Phase 5</H1>
			    	</section>			    				    			    				    	
			    </HorizontalScrollPage>
		    </Wrapper>
		);
	}

}

export default WatchOrder;
